    false,nt"url": null,nt"notes": "This report contains locations and water
    use at Browns Park NWR for 1997. A general background is presented first with water
    rights information, management considerations, and lastly habitat considerations.
    Data for each diversion/impoundment at Browns Park NWR is supplied. This data includes
    the height above the gauge for each feature at the end of each month, as well as
    graphs of proposed water levels vs actual water levels. Following the data is a
    brief summary of water use at the diversion/impoundment, and then by another short
    paragraph highlighting any important wildlife use seen over the year. Additionally
    a proposed management plan for the following year is presented.",nt"owner_org":
